import React from "react";
import "./Components.css";
import me from './me.jpg'
import Partilces from 'react-particles-js'

function Home() {
  return (
    
    <div className="home">
      <Partilces style={{width:'100%',}}>
      <div>
        <img src={me} alt="Me"/>
        
      </div>
      </Partilces>
    </div>
   
  );
}

export default Home;
